const asyncHandler = require("express-async-handler");
const fs = require("fs");
const Product = require("../models/products");
const path = require("path");
var pdf = require("pdf-creator-node");
const Stand = require("../models/stands");

const fetchAllProductsByStandId = asyncHandler(async (req, res, next) => {
  let existingProducts;
  try {
    existingProducts = await Stand.findByPk(req.params.standId, {
      include: Product,
    });
  } catch (err) {
    return res.status(500).json(err);
  }
  if (existingProducts.length === 0) {
    return res.status(200).json([]);
  }
  return res.status(200).json(existingProducts);
});
const fetchAllProducts = asyncHandler(async (req, res, next) => {
  let existingProducts;
  try {
    existingProducts = await Product.findAll({ include: Stand });
  } catch (err) {
    return res.status(500).json(err);
  }
  if (existingProducts.length === 0) {
    return res.status(200).json([]);
  }
  return res.status(200).json(existingProducts);
});

const createNewProduct = asyncHandler(async (req, res, next) => {
  const {
    body: {
      product_en_name,
      product_en_desc,
      product_barcode,
      product_sku,
      quantity,
      model_number,
    },
    file,
  } = req;

  let existingProducts;
  try {
    existingProducts = await Product.findOne({
      where: { product_sku: product_sku },
    });
  } catch (err) {
    return res.status(500).json(err);
  }

  if (existingProducts) {
    res.status(422).json({ message: "Product exists already." });
  }
  let createdProduct;
  try {
    createdProduct = await Product.create({
      product_en_name,
      product_en_desc,
      image_url: file.path,
      product_barcode,
      quantity,
      product_sku,
      model_number,
    });
  } catch (err) {
    return res.status(500).json(err);
  }

  return res.status(201).json(createdProduct);
});

const updateProduct = asyncHandler(async (req, res, next) => {
  const productId = req.params.id;
  console.log(req.body);
  let existiedProduct;
  try {
    existiedProduct = await Product.findByPk(productId);
    if (!existiedProduct) {
      return res.status(404).json("no product with the given id");
    }
  } catch (error) {
    return res.status(500).json(error);
  }
  const {
    product_ar_name,
    product_en_name,
    product_en_desc,
    product_ar_desc,
    product_barcode,
    product_sku,
    quantity,
    model_number,
  } = req.body;
  let updatedProduct;
  try {
    updatedProduct = await existiedProduct.update({
      product_ar_name: product_ar_name || existiedProduct.product_ar_name,
      product_en_name: product_en_name || existiedProduct.product_en_name,
      product_en_desc: product_en_desc || existiedProduct.product_en_desc,
      product_ar_desc: product_ar_desc || existiedProduct.product_ar_desc,
      product_barcode: product_barcode || existiedProduct.product_barcode,
      product_sku: product_sku || existiedProduct.product_sku,
      quantity: quantity || existiedProduct.quantity,
      model_number: model_number || existiedProduct.model_number,
    });
    return res.status(201).json(updatedProduct);
  } catch (err) {
    return res.status(500).json(err);
  }
});

const deleteProduct = asyncHandler(async (req, res, next) => {
  const productId = req.params.id;
  let existiedProduct;
  try {
    existiedProduct = await Product.findByPk(productId);
    await existiedProduct.destroy();
    console.log(existiedProduct);
    if (existiedProduct) {
      fs.unlink(existiedProduct.image_url, (err) => {
        if (err) {
          return res.status(500).json(err);
        }
      });
    }
  } catch (error) {
    return res.status(500).json(err);
  }

  return res.status(201).json("Product deleted successfully");
});

